//SPDX-License-Identifier: MIT

pragma solidity >=0.4.22 <0.9.0;

import "./Ownable.sol";

contract Rack is Ownable{


struct S_Rack{
        string _space;
        mapping(uint => S_Item) _device;
        mapping(uint => S_Report) _report;
        uint _deviceIndex;
        uint _reportIndex;
        mapping(uint => string) _document;
        uint _sizeOfDocument;
    }
    
struct S_Item{
        string _brand;
        string _model;
        string _serial;
        string _mac;
        DeviceState _state;
}

struct S_Report{
        uint _date;
        string _name;
        string _details;
}
    enum DeviceState{Failed, Ok, Repairing, Loan, Removed}
    event DeviceAdded(string _brand, string _model, string _serial, DeviceState);
    
    S_Rack rack;
    uint deviceIndex;
    uint reportIndex;
    uint documentIndex;
    bool writeable;
    bool isPayable;
    
    // Runs on creation
    constructor(address _owner, string memory _name){
        rack._space = _name;
        transferOwnership(_owner);
        writeable = true;
        isPayable = false;
    }

    function setWriteableState(bool _state) public onlyOwner{
        writeable = _state;
    }
    
    // Add a new device to system rack
    function addDevice(string memory _brand, string memory _model, string memory _serial, string memory _mac, DeviceState _state) public{
        require(writeable == true,'Read only');
        rack._device[deviceIndex]._brand = _brand;
        rack._device[deviceIndex]._model = _model;
        rack._device[deviceIndex]._serial = _serial;
        rack._device[deviceIndex]._mac = _mac;
        rack._device[deviceIndex]._state = _state;
        emit DeviceAdded(rack._device[deviceIndex]._brand, rack._device[deviceIndex]._model, rack._device[deviceIndex]._serial, rack._device[deviceIndex]._state);
        deviceIndex ++ ;
    }
    
    // Set device state of device 0 = "Failed" , 1 = "Ok" , 2 = "Repairing" , 3 = "Loan" , 4 = "Removed"
    function setDeviceState(uint _id, DeviceState _state) public{
        require(writeable == true,'Read only');
        rack._device[_id]._state = _state;
    }
    
    // Add serivce report to system rack
    function addReport(string memory _name, string memory _report) public{
        require(writeable == true,'Read only');
        rack._report[reportIndex]._date = block.timestamp;
        rack._report[reportIndex]._name = _name;
        rack._report[reportIndex]._details = _report;
        reportIndex ++;
    }

    function addDocument(uint _num, uint _of, string memory _base64) public{
        require(writeable == true,'Read only');
        rack._document[_num]= _base64;
        rack._sizeOfDocument = _of;
        //documentIndex ++;
    }

    function documentSize() public view returns(uint _sizeOfDocument){
        return rack._sizeOfDocument;
    }

    function seeDocument(uint _index) public view returns(string memory _document){
        return rack._document[_index];
    }
    
    // Returns number of device to run for loop
    function howManyDevices() public view returns(uint _devices){
        return deviceIndex;
    }
    
    // Returns data for device
    function seeDevice(uint _id) public view returns(string memory _brand, string memory _model, string memory _serial, string memory _mac, DeviceState _state){
        require(_id < deviceIndex, "Not a valid device");
        return(rack._device[_id]._brand, rack._device[_id]._model, rack._device[_id]._serial, rack._device[_id]._mac, rack._device[_id]._state);
    }
    function seeDeviceLoop() public view returns(string[] memory _brand, string[] memory _model, string[] memory _serial, string[] memory _mac, DeviceState _state){
        uint _index = deviceIndex;
        string[] memory _localBrand = new string[](_index);
        string[] memory _localModel = new string[](_index);
        string[] memory _localSerial = new string[](_index);
        string[] memory _localMac = new string[](_index);
        for(uint i=0; i<_index; i++){
            _localBrand[i] = rack._device[i]._brand;
            _localModel[i] = rack._device[i]._model;
            _localSerial[i] = rack._device[i]._serial;
            _localMac[i] = rack._device[i]._mac;
        }
        return(_localBrand,_localModel,_localSerial,_localMac, rack._device[0]._state);
    }
    
    // Returns number of device to run for loop
    function howManyReports() public view returns(uint _reports){
        return reportIndex;

    }
    
    // Returns report for system rack
    function seeReport(uint _id) public view returns(uint _time, string memory _name, string memory _report){
        require(_id < reportIndex, "Not a valid report");
        return(rack._report[_id]._date, rack._report[_id]._name, rack._report[_id]._details);
    }
    function seeReportLoop() public view returns(uint[] memory _time, string[] memory _name, string[] memory _report){
        uint _index = reportIndex;
        uint[] memory _localTime = new uint[](_index);
        string[] memory _localName = new string[](_index);
        string[] memory _localReport = new string[](_index);
        for(uint i=0; i<_index; i++){
            _localTime[i] = rack._report[i]._date;
            _localName[i] = rack._report[i]._name;
            _localReport[i] = rack._report[i]._details;
        }
        return(_localTime,_localName,_localReport);
    }
    
    receive() external payable {
        require(isPayable == true, "Do not send funds to this contract!");
    }
    
    fallback() external {
        
    }
    
}
